import React from 'react';
import './App.css';
import Routes from "./routes/Routes";
import SideBar from "./component/Nav/SideBar"
import Login from "./component/Login/Connection";
const isConnected = this.state.connected
function IsConnected(){
  if(isConnected){
    return <SideBar/>
  }
  else{
    return <Login/>
  }
}

function App() {
  return (
    <div className="App" >
      <IsConnected/>
        <Routes/>
    </div>
  );
}

export default App;
